ngx_http_output_body_filter_pt ngx_http_top_body_filter;
ngx_http_request_body_filter_pt ngx_http_top_request_body_filter; 这同样适用于变量的初始化表达式，如下： ngx_str_t ngx_http_html_default_types[] = { ngx_string("text/html"), ngx_null_string
};

